import { configureStore } from "@reduxjs/toolkit";
import inputReducer from "../features/inputSlice";
import userProfileReducer from ""




const store = configureStore({
    reducer: {
        input: inputReducer,
        userProfile: userProfileReducer,
    }
})

export default store
